(N'Thiếc Hàn Không Chì Cao Cấp 99.3%',4,N'Thiếc Hàn 99.3 % 0.8 50g là một trong những sản phẩm thiếc hàn tốt nhất,là hợp kim của thiếc nguyên chất và một số chất liệu khác. Có nhiệt độ nóng chảy dao động từ 95ºC~450ºC được sử dụng được liên kết các bề mặt kim loại khác nhau. Sử dụng phù hợp với tất cả tay hàn và máy hàn các loại',69000,999,'image.jpg',GETDATE()),
(N'Khò Gas Đơn',4,N'Khò gas đơn là phụ kiện được ứng dụng nhiều trong cuộc sống hàng ngày: để nấu ăn, đốt cháy, làm nóng thiết bị ... nhiệt độ có thể lên đến 1300 oC',109000,999,'image.jpg',GETDATE()),
(N'Bể Nhúng Thiếc Soldering  ZTX-31C',4,N'Bể Nhúng Thiếc ZTX - 31C được sử dụng trong quá trình hàn linh kiện điện tử lên bề mặt PCB diễn ra nhanh chóng và dễ dàng hơn rất nhiều so với hàn bằng tay, chất lường hàn đẹp và đều hơn rất nhiều so với sử dụng mỏ hàn thông thường. bên cạnh đó có thể sử dụng để xử lý thiếc dư, hoặc tháo chân linh kiên...',275000,999,'image.jpg',GETDATE()),
(N'Bể Nấu Thiếc ZTX-41D',4,N'Máy nấu thiếc 350W là phụ kiện hàn được dùng làm bể hàn nhúng thiếc hay bể hàn nhúng mạch điện, khắc phục, xử lý thiếc dư hoặc giúp tháo chân linh kiện trong mạch in cách dễ dàng hơn với công suất 350W, nồi nấu thiếc có đường kính 100 mm. Đặc biệt, nồi nấu thiếc được tráng titanium có độ bền cao, chống ăn mòn',269000,999,'image.jpg',GETDATE()),
(N'Máy Hàn Quick 936A',4,N'Máy hàn quick 936A là một trong những máy hàn mà linh kiện điện tử 3M nhập khẩu về để cung cấp cho khách hàng. Máy hàn thiếc quick 936a loại tốt, hàng chính hãng rất được ưa chuộng - là sản phẩm bán chạy nhất của 3M trong các máy hàn. Chất lượng luôn là sự lựa chọn hàng đầu, máy hàn quick 936a được thiết kế nhỏ gọn, lên nhiệt nhanh, hoạt động ổn định. Đặc biệt, máy hàn nhiệt quick 936a tại 3M luôn có giá rẻ nhất trên thị trường.',850000,999,'image.jpg',GETDATE()),
(N'Combo Máy hàn hakko 936',4,N'Bộ combo Trạm hàn Hakko 936 và 1 mũi hàn dao 900M T-K là bộ combo máy hàn được sử dụng nhiều trong cuộc sống hằng ngày, chuyên dùng tại các cửa hàng sửa chữa điện tử ... đặc biệt với mũi hàn 900M-TK đi kèm dễ dàng cho việc thay tháo khi mũi hàn của hakko 936 bị hỏng.',338000,999,'image.jpg',GETDATE()),
(N'Mỏ Hàn Tự Động Đẩy Thiếc Asaki AK-9095',4,N'Mỏ Hàn Tự Động Đẩy Thiếc Asaki AK-9095 220VAC 60W là sản phẩm đến từ thương hiệu Asaki, một trong những thương hiệu sản xuất các dụng cụ cầm tay và thiết bị nổi tiếng được nhiều người tiêu dùng Việt lựa chọn. Sản phẩm được sản xuất trên dây chuyền công nghệ hiện đại, gia công từ những vật liệu cao cấp, công suất hoạt động mạnh mẽ, thiết kế nhỏ gọn, hoàn toàn phù hợp khi làm việc tại các xưởng cơ khí hay xưởng sản xuất xe hơi.',189000,999,'image.jpg',GETDATE()),
(N'Mỏ Hàn Nhiệt Dạng Súng Soldering IRON',4,N'Mỏ Hàn Nhiệt Dạng Súng Soldering IRON 25W/80W Là loại mỏ hàn có thiết kế nhỏ gọn giúp bạn có thể mang đi được nhiều nơi hay khi bỏ trong túi đồ nghề mà không tốn nhiều diện tích. Mỏ hàn Soldering Iron đặc biệt với nút bấm giúp tăng hiệu quả hoạt động có thể tăng công suất từ 25 lên đến 80W. Tuy có kích thước khá nhỏ nhưng mỏ hàn khi cầm lên lại rất chắc tay giúp bạn có thể hàn được những mối hàn đẹp và chính xác hơn. ',95000,999,'image.jpg',GETDATE()),
(N'Thiếc Hàn Không Chì Hàn Quốc WIRE SOLDER',4,N'Thiếc Hàn Không Chì Hàn Quốc WIRE SOLDER giúp cho việc hàn của bạn trở nên dễ dàng, và an toàn hơn rất nhiều. Thiếc không chứa chì bạn có thể yên tâm sử dụng mà không lo độc hại. Với nhiệt độ nóng chảy thấp ở mức 227 độ C và kích thước sợi thiếc nhỏ chỉ 0.6mm giúp cho việc hàn của bạn trở nên nhanh chóng và dễ dàng hơn rất nhiều đặc biệt với những mối hàn nhỏ cần sử tỉ mỉ. Thành phần Sn- 0.7 Cu cho mối hàn đẹp, sáng bóng và chống oxi hóa cao hơn rất nhiều so với các loại thiếc hàn thông thường. ',99000,999,'image.jpg',GETDATE()),
(N'Tay Hàn Quick 907A',4,N'Tay Hàn Quick 907A Zin là loại tay hàn cao cấp được dùng cho trạm hàn Quick 936, Quick 907. Sensor nhiệt bằng đồng cao cấp có khả năng chịu nhiệt cao và sử dụng được rất bền. Tay hàn thiết kế nhỏ gọn chắc chắn, với mũi hàn nhỏ cho các mối hàn được đẹp và chính xác hơn.',299000,999,'image.jpg',GETDATE()),
(N'Máy Khò Hơi Nóng PENGLONG DZL-A1',4,N'Máy Khò Hơi Nóng PENGLONG DZL-A1 1600W là thiết bị sử dụng phổ biến  trong đóng gói bao bì, sấy nóng, sấy khô,... Bạn cũng có thể sử dụng máy để tháo chân linh kiện. hàn nhựa, làm khô sơn, khô keo... Máy khò có thể điều chỉnh nhiệt độ dễ dàng từ 50~550 độ C, giúp cho quá trình sử dụng dễ dàng.',349000,999,'image.jpg',GETDATE()),
(N'Máy Khò Hơi Nóng Asaki Chính Hãng',4,N'Máy Khò Hơi Nóng Asaki   phù hợp sử dụng cho thợ sửa chữa điện tử, điện thoại, dán màn hình, đóng gói sản phẩm, sấy khô, sấy nóng…. có thể sử dụng để hàn ghép các loại ống nhựa PVC, vải tổng hợp, làm khô keo, khô sơn... Máy khò Asaki có 2 loại công suất cho bạn lựa chọn là 1600W và 2000W  với công suất cao cho thời gian ra nhiệt nhanh, máy còn có 2 chế độ HIGH và LOW giúp bạn dễ dàng điều chỉnh nhiệt độ để sử dụng.',400000,999,'image.jpg',GETDATE()),
(N'Bộ nguồn, bộ sạc 27W USB-C ',5,N'Nguồn điện Raspberry Pi 5, với công suất 27W và dòng điện 5A, cung cấp năng lượng dồi dào và ổn định cho mọi hoạt động của bo mạch. Thiết kế tối ưu giúp nguồn điện hoạt động hiệu quả, kéo dài tuổi thọ cho Raspberry Pi 5. Đây là lựa chọn hoàn hảo cho những ai đang tìm kiếm một nguồn điện đáng tin cậy và mạnh mẽ để phục vụ các dự án của mình.',395000,999,'image.jpg',GETDATE()),
(N'Adapter Điều Chỉnh Điện Áp 3.6-24VDC',5,N'Adapter Điều Chỉnh Điện Áp 3.6-24VDC Màn Hình Hiển Thị có thiết kế nhỏ gọn, chắc chắn, thường được sử dụng để cấp nguồn, test sản phẩm: Motor, broad mạch điện,... với khả năng cấp dòng đầu ra 2A, biến trở áp linh hoạt từ 3- 24VDC, tích hợp đồng hồ đo áp đầu ra giúp dễ dàng quan sát, thực nghiệm, cấp nguồn cho rất nhiều ứng dụng khác.',189000,999,'image.jpg',GETDATE()),
(N'Nguồn Pi 3/ Pi 4 USB 5V 3A',5,N'Nguồn Raspbery Pi 3 / Pi 4 5V 3A dành cho Raspbery là nguồn có chất lượng rất tốt, với dòng ra lên tới 3A, cung cấp đủ nguồn điện với dòng cho Pi để hoạt động ổn định, đạt hiệu suất làm việc tốt nhất.',95000,999,'image.jpg',GETDATE()),
(N'Nguồn Adapter 3V-2A',5,N'Nguồn Adapter 3V-2A  được sử dụng để cấp nguồn điện cho các thiết bị sử dụng nguồn ra 3V, được sử dụng để cấp nguồn cho các thiết bị như mạch điện tử, các loại động cơ, máy khoan mài mini. Adaptor sử dụng jack cắm 5.5x2.1mm được sử dụng rất phổ biến trong nhiều thiết bị. Nguồn adapter 3V 2A được bán tại Linh Kiện Điện Tử 3M là loại được sản xuất bởi các loại linh kiện chất lượng, có độ bền cao, an toàn khi sử dụng và cũng như bảo vệ tuổi thọ cho các thiết bị được sử dụng',36000,999,'image.jpg',GETDATE()),
(N'Nguồn Pi 3 / Pi 3+ 5V 2.5A',5,N'Nguồn Pi 3 / Pi 3+ 5V 2.5A  dành cho Raspbery là nguồn có chất lượng rất tốt, với dòng ra lên tới 2.5A, cung cấp đủ nguồn điện với dòng cho Pi để hoạt động ổn định, đạt hiệu suất làm việc tốt nhất.',95000,999,'image.jpg',GETDATE()),
(N'Nguồn Adapter 48V-2A Jack 5.5*2.1mm',5,N'Adapter 48V 2A 48V 2A thích hợp cho các thiết bị điện sử dụng dòng điện một chiều với tác dụng tránh hiện tượng quá tải, quá dòng ... đảm bảo tuổi thọ cho các thiết bị. Bộ chuyển đổi điện áp có dải đầu vào rộng từ 100V đến 240V dễ dàng cho việc sử dụng, và đưa điện áp đầu vào.',159000,999,'image.jpg',GETDATE()),
(N'Adapter Điều Chỉnh Điện Áp 9-24VDC 1A',5,N'Nguồn adapter điều chỉnh điện áp có chức năng bảo vệ quá dòng, chạm mạch với núm điều chỉnh điện áp từ 9 - 24VDC, phù hợp cho nhiều thiết bị điện, để đảm bảo tuổi thọ cho chúng. Adapter đa năng là dụng cụ chuyển dòng xoay chiều sang dòng một chiều với thiết kế nhỏ gọn. Nguồn adapter có một đầu kết nối với nguồn điện 100 - 240VAC và 1 đầu nối với các thiết bị điện với 9  - 24VDC. ',120000,999,'image.jpg',GETDATE()),
(N'Nguồn Adapter 9V-2A 5.5*2.1mm',5,N'Nguồn Adapter 9V-2A  Dùng cấp nguồn cho Modem, Bộ phát wifi, Switch, máy chấm công, bộ chia usb, bộ chia vga, hdd box...Nguồn cho camera đầu jack nguồn 5.5x2.1 tương thích với nhiều thiết bị. Thiết kế nhỏ gọn chắc chắn.',39000,999,'image.jpg',GETDATE()),
(N'Nguồn Adapter 24V 1A 5.5*2.1',5,N'Nguồn 24V 1A thích hợp để sử dụng sạc các thiết bị như bộ chia, bộ chuyển đổi cấp nguồn cho Modem, Bộ phát wifi, Switch... thiết kề nhỏ gọn chắc chắn và mạch điện chất lượng chống sụt dòng. Bạn có thể yên tâm khi sử dụng để cấp nguồn cho các thiết bị cũng như bảo vệ và nâng cao tuổi thọ của sản phẩm. Sản phẩm đang được bán tại Linh Kiện Điện Tử 3M và bảo hành lên đến 6 tháng bạn có thể yên tâm khi sử dụng sản phẩm.',45000,999,'image.jpg',GETDATE()),
(N'Nguồn Adapter 24V 2A 5.5*2.1',5,N'Là bộ chuyển đổi nguồn AC ra DC với điện áp ra 24V 2A thích hợp sử dụng với nhiều thiết bị điện sử dụng dòng điện một chiều với tác dụng tránh hiện tượng quá tải, quá dòng ... đảm bảo tuổi thọ cho các thiết bị. Bộ chuyển đổi điện áp có dải đầu vào rộng từ 100V đến 240V dễ dàng cho việc sử dụng, và đưa điện áp đầu vào.',75000,999,'image.jpg',GETDATE()),
(N'Nguồn Adapter 5V 2A Jack Nhỏ 3.5*1.5mm',5,N'Dùng cấp nguồn cho Modem, Bộ phát wifi, Switch, máy chấm công, bộ chia usb, bộ chia vga, hdd box...Nguồn cho camera. Nguồn có chức năng bảo vệ quá dòng an toàn và bảo vệ sản phẩm. Nguồn 5V 2A được bảo hành 6 tháng khi mua tại Linh Kiện Điện Tử 3M',36000,999,'image.jpg',GETDATE()),
(N'Adapter Điều Chỉnh Điện Áp 3-12VDC 2A 5.5x2.1',5,N'Nguồn adapter điều chỉnh điện áp là adapter có chức năng bảo vệ quá dòng, chạm mạch với núm điều chỉnh điện áp từ 3 - 12VDC, phù hợp cho nhiều thiết bị điện, để đảm bảo tuổi thọ cho chúng. Adapter đa năng là dụng cụ chuyển dòng xoay chiều sang dòng một chiều với thiết kế nhỏ gọn. Nguồn adapter có một đầu kết nối với nguồn điện 100 - 240VAC và 1 đầu nối với các thiết bị điện với 3  - 12VDC. ',84000,999,'image.jpg',GETDATE()),
(N'Động cơ rung điện thoại 1030 10x3.0mm 3-5VDC',6,N'Động cơ rung điện thoại 1030 là một loại động cơ điện nhỏ gọn, được thiết kế đặc biệt để tạo ra các rung động cơ học khi có dòng điện chạy qua. Khi được tích hợp vào điện thoại di động, chúng tạo ra cảm giác rung khi có cuộc gọi đến, tin nhắn mới hoặc các thông báo khác.',10000,999,'image.jpg',GETDATE()),
(N'Động Cơ Giảm Tốc 180 Bánh Răng Kim Loại',6,N'Động Cơ Giảm Tốc 180 Bánh Răng Kim Loại được sử dụng trong một số cơ cấu chuyển động của robot, mô hình xe ô tô, xe tự cân bằng và nhiều mô hình, thiết bị khác.',39000,999,'image.jpg',GETDATE()),
(N'Động Cơ Phát Điện Mini 6.5V',6,N'Động Cơ Phát Điện Mini 6.5V là loại động cơ được sử dụng để tạo ra dòng điện có điện áp 6.5V. Động cơ phát điện Mini được sử dụng trong nhiều trong các sản phẩm tự chế. Chúng được ứng dụng làm nút đề, công tắc đề,....Động cơ phát điện sử dụng động cơ RF-370C có chất lượng tốt, tốc độ quay ổn định và bền với thời gian.',25000,999,'image.jpg',GETDATE()),
(N'Bộ Động Cơ Quạt Lò Vi Sóng 2 Chân',6,N'Bộ Động Cơ Quạt Lò Vi Sóng 2 Chân là bộ sản phẩm được sử dụng để hâm nóng đồ ăn của lò vi sóng. Cuộn dây đồng của động cơ tạo ra từ trường, nó hoạt động như thanh đốt, làm chín thức ăn từ trong ra ngoài. Giúp thức ăn được chín vừa đủ, đảm bảo cả về mùi vị cũng như chất lượng.',89000,999,'image.jpg',GETDATE()),
(N'Động Cơ Giảm Tốc 50KTYZ 220VAC 6W',6,N'Động Cơ Giảm Tốc 50KTYZ được sử dụng chủ yếu trong dụng cụ, tự động hóa, máy dán, đèn sân khấu và thiết bị hiển thị quảng cáo, điều khiển tự động rèm, điều chỉnh điện áp rự động,... Động cơ giảm tốc 50KTYZ có khối lượng nhỏ nhưng mo-men xoắn lớn, độ ổn định cao, không bị ảnh hưởng bởi điện áp. Ngoài ra, động cơ 50KTYZ có bánh răng được làm từ kim loại, dây đồng nguyên chất và tốc độ không đổi.',169000,999,'image.jpg',GETDATE()),
(N'Diy Động Cơ Mã Hóa Xe Thông Minh',6,N'Diy Động Cơ Mã Hóa Xe Thông Minh được sử dụng cho các loại xe mô hình, xe tự chế có bánh xe đảo chiều linh hoạt. Diy sử dụng động cơ 6V 10800 vòng/phút chất lượng cao, tốc độ quay ổn định.',75000,999,'image.jpg',GETDATE()),
(N'Động Cơ Máy Hút Bụi 220VAC 1200W',6,N'Động Cơ Máy Hút Bụi 1200W các loại Trong quá trình sử dụng thì động cơ máy hút bụi có thể xảy ra các sự cố như chập cháy, nóng nhanh,... gây ảnh hưởng tới hoạt động của máy cũng như năng suất vệ sinh. Bởi vậy, khi phát hiện những sự cố bất thường ở motor máy hút bụi thì người dùng cần sửa chữa, thay mới kịp thời. Dùng cho: Máy hút bụi Hiclean, Cleantech, Topclean….',299000,999,'image.jpg',GETDATE()),
(N'Động Cơ Bước 86BYG250H 1.8 Độ 12Nm 5.6A Trục 150mm',6,N'Động Cơ Bước 86BYG250H 1.8 Độ được ứng dụng nhiều trong tự động hóa, trong các loại máy móc điều khiển cần có sự chính xác cao ... dùng để biến đổi các tín hiệu điều khiển dưới dạng các xung điện rời rạc kế tiếp nhau thành các chuyển động góc quay. Động Cơ Bước 86BYG250H hoạt động êm không gây tiếng ồn, 1.8 độ/1 step với độ sai số thấp 5%, momemt xoắn 12N.m, dòng điện hoạt động 5.6A.',1459000,999,'image.jpg',GETDATE()),
