(N'Động Cơ Giảm Tốc 60KTYZ 220VAC 14W',6,N'Động Cơ Giảm Tốc 60KTYZ  sử dụng chủ yếu trong các thiết bị như: chiếu sáng sân khấu, điều khiển tự động, máy kéo, thiết bị quảng cáo,... , thiết bị y tế, cơ sở nghiên cứu khoa học, thiết bị thể thao, rèm tự động, điều chỉnh áp suất tự động, đèn sân khấu, dụng cụ khoa học và giáo dục. Động Cơ Giảm Tốc 60KTYZ hoạt động ổn định và bền bỉ, được cấu tạo bởi dây đồng nguyên chất và bánh răng bằng kim loại.',189000,999,'image.jpg',GETDATE()),
