(N'IC chuyển đổi DAC0808LCN DIP16',8,N'DAC0808LCN DIP16 là một mạch tích hợp (IC) thuộc loại bộ chuyển đổi số sang tương tự (Digital-to-Analog Converter - DAC). Nói cách khác, nó có chức năng chuyển đổi tín hiệu số (dạng bit 0 và 1) thành tín hiệu tương tự (dạng điện áp hoặc dòng điện).',23000,999,'image.jpg',GETDATE()),
(N'IC mã hóa 74HC148 Dip 16',8,N'IC 74HC148 DIP-16 là một mạch tích hợp số thuộc họ CMOS, được sử dụng để mã hóa các tín hiệu đầu vào thành một mã nhị phân. Nó là một bộ mã hóa ưu tiên 8-to-3, có nghĩa là nó nhận 8 đầu vào và tạo ra 3 đầu ra tương ứng với mã nhị phân của đầu vào có mức logic cao nhất.',12000,999,'image.jpg',GETDATE()),
(N'IC 74HC393 Dip 14',8,N'IC 74HC393 DIP-14 là một mạch tích hợp số thuộc họ CMOS, được sử dụng rộng rãi trong các hệ thống điện tử kỹ thuật số, là một bộ đếm nhị phân 4 bit kép, có nghĩa là nó bao gồm hai bộ đếm 4 bit độc lập trong cùng một gói IC, cung cấp mạch đếm MOD-2 (2 trạng thái đếm) và mạch đếm MOD-5 (5 trạng thái đếm).',9000,999,'image.jpg',GETDATE()),
