(N'74LS76 Dual J-K Flip-Flop (with Preset and Clear)',8,N'IC 74LS76 chứa bốn cổng Exclusive-OR(XOR) 2 đầu vào độc lập. 74LS76 thực hiện các hàm Boolean Y = A B = AB + AB theo mức logic dương. IC 74LS76 được ứng dụng nhiều trong các mạch điện tử kỹ thuật số.',7000,999,'image.jpg',GETDATE()),
(N'IC 74HC192 DIP16',8,N'IC 74HC192 là IC thuộc họ TTL có chức năng đếm không đồng bộ, bộ đếm BCD thuận nghịch lập trình được. IC 74HC192 là bộ đếm MOD 10 nhưng có thể đầu nối các cách khác nhau để đếm được các MOD khác nhau: MOD2, MOD3, MOD5...',11000,999,'image.jpg',GETDATE()),
(N'Module IC Thời Gian Thực DS3231 AT24C32 I2C',8,N'Module IC Thời Gian Thực DS3231 AT24C32 I2C là module đồng hồ thời gian thực giao tiếp qua chuẩn I2C và có ưu điểm là cực kỳ chính xác với bộ dao động thạch anh nội có tính năng bù nhiệt.IC có đầu vào cho pin riêng, tách biệt khỏi nguồn chính đảm bảo cho việc giữ thời gian chính xác.',39000,999,'image.jpg',GETDATE()),
(N'74HC27 Triple 3-input NOR gate DIP14',8,N'IC 74HC27 được tích hợp ba cổng điều khiển logic NOR  tương thích với Schottky TTL công suất thấp (LSTTL). Mỗi cổng NOR trong IC 74HC27 có ba đầu vào và một cổng đảo đầu ra, chúng được sử dụng trong các board mạch kỹ thuật số để cấu tạo nên các chức năng nhiệm vụ cho từng thiết bị điện tử.',5500,999,'image.jpg',GETDATE()),
(N'SN74HC47 BCD to 7-Segment',8,N'IC SN74HC47N 8 bit được thiết kế để ứng dụng trong các hệ thống kỹ thuật số, IC gồm các thanh ghi và các bộ giải mã. IC có khả năng lưu trữ dữ liệu với 4 chế độ hoạt động riêng biệt có thể được lựa chọn bằng cách kiểm soát các đầu vào và được kích hoạt như đã được liệt kê trong bảng giá trị.',9000,999,'image.jpg',GETDATE());